    internal static string[] GetNames()
    {
      List<string> stringList = new List<string>();
      foreach (string str in Metrology.list)
      {
        string name = Metrology.GetName(ProgFileTools.parseINTEL_HEX_file(str.Replace(" ", string.Empty)).Values.First<byte[]>());
        if (!(name == "CALTOS_E_2F_Compact_v1.1") && !(name == "M8_2F_Compact_v1.1") && !stringList.Contains(name))
          stringList.Add(name);
      }
      return stringList.ToArray();
    }

    internal static string GetName(byte[] buffer)
    {
      Metrology.Type type = (Metrology.Type) buffer[0];
      Metrology.Device device = (Metrology.Device) ((uint) buffer[1] & 1U);
      Metrology.Housing housing = (Metrology.Housing) ((int) buffer[1] >> 1 & 1);
      byte num1 = buffer[2];
      byte num2 = buffer[3];
      return type.ToString() + device.ToString() + housing.ToString() + "_v" + num1.ToString() + "." + num2.ToString();
    }

    internal static byte[] GetBytes(FirmwareVersion version, string name)
    {
      string[] array = new List<string>((IEnumerable<string>) Metrology.GetNames()).FindAll((Predicate<string>) (x => x.StartsWith(name))).ToArray();
      Array.Sort<string>(array);
      name = array[array.Length - 1];
      foreach (string str in Metrology.list)
      {
        SortedDictionary<uint, byte[]> intelHexFile = ProgFileTools.parseINTEL_HEX_file(str.Replace(" ", string.Empty));
        byte[] buffer = intelHexFile.Values.First<byte[]>();
        byte num1 = buffer[2];
        byte num2 = buffer[3];
        if (num1 != (byte) 1)
          throw new NotImplementedException();
        if (Metrology.GetName(buffer) == name)
        {
          List<byte> byteList = new List<byte>();
          foreach (KeyValuePair<uint, byte[]> keyValuePair in intelHexFile)
            byteList.AddRange((IEnumerable<byte>) keyValuePair.Value);
          return byteList.ToArray();
        }
      }
      return (byte[]) null;
    }

    private enum Type : byte
    {
      M8 = 1,
      CALTOS_E = 2,
      M7plus = 3,
    }

    private enum Device : byte
    {
      _1F,
      _2F,
    }

    private enum Housing : byte
    {
      _Compact,
      _Remote,
    }
